import React, {Component} from 'react'
import axios from 'axios'

class Random extends Component {
    state = {
        data: []
    }

    componentDidMount() {
        axios.get('http://127.0.0.1:8000/api/')
        .then(res => {
            this.setState({
                data: res.data
            })
            console.log(res.data);
        })
    }
}
